"use client"

import { useState } from "react"
import { Link } from "react-router-dom"
import { motion } from "framer-motion"
import { useAuth } from "../hooks/useAuth"
import { useToast } from "../hooks/useToast"
import LoadingSpinner from "../components/LoadingSpinner"

function LoginPage() {
  const [formData, setFormData] = useState({
    email: "",
    password: "",
  })
  const [loading, setLoading] = useState(false)

  const { login } = useAuth()
  const { addToast } = useToast()

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    })
  }

  const handleSubmit = async (e) => {
    e.preventDefault()
    setLoading(true)

    try {
      await login(formData.email, formData.password)
      addToast("Login successful!", "success")
    } catch (error) {
      addToast(error.message, "error")
    } finally {
      setLoading(false)
    }
  }

  return (
    <div className="min-h-screen flex items-center justify-center bg-reva-light px-4 py-12">
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.6 }}
        className="w-full max-w-md bg-white rounded-2xl shadow-xl p-8 border border-reva-orange"
      >
        <div className="flex flex-col items-center mb-6">
          <img src="/placeholder-logo.png" alt="REVA Logo" className="h-14 mb-2" />
          <motion.h2
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ delay: 0.2 }}
            className="text-3xl font-extrabold text-reva-orange text-center drop-shadow-sm"
          >
            REVA Project Marketplace
          </motion.h2>
          <motion.p
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ delay: 0.3 }}
            className="mt-2 text-center text-base text-reva-dark"
          >
            Sign in to your account
          </motion.p>
        </div>

        <motion.form
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.4 }}
          className="space-y-6"
          onSubmit={handleSubmit}
        >
          <div className="space-y-4">
            <div>
              <label htmlFor="email" className="form-label text-reva-dark">
                Email address
              </label>
              <input
                id="email"
                name="email"
                type="email"
                required
                className="form-input border-reva-orange focus:ring-2 focus:ring-reva-orange focus:border-reva-orange"
                placeholder="Email address"
                value={formData.email}
                onChange={handleChange}
              />
            </div>
            <div>
              <label htmlFor="password" className="form-label text-reva-dark">
                Password
              </label>
              <input
                id="password"
                name="password"
                type="password"
                required
                className="form-input border-reva-orange focus:ring-2 focus:ring-reva-orange focus:border-reva-orange"
                placeholder="Password"
                value={formData.password}
                onChange={handleChange}
              />
            </div>
          </div>

          <div>
            <motion.button
              whileHover={{ scale: 1.02 }}
              whileTap={{ scale: 0.98 }}
              type="submit"
              disabled={loading}
              className="w-full py-2 px-4 bg-reva-orange text-white rounded-lg font-semibold shadow hover:bg-reva-blue focus:outline-none focus:ring-2 focus:ring-reva-orange focus:ring-offset-2 disabled:opacity-50 disabled:cursor-not-allowed transition-colors"
            >
              {loading ? <LoadingSpinner size="sm" /> : "Sign in"}
            </motion.button>
          </div>

          <div className="text-center mt-2">
            <Link to="/register" className="font-medium text-reva-blue hover:text-reva-orange transition-colors">
              Don't have an account? Sign up
            </Link>
          </div>
        </motion.form>
      </motion.div>
    </div>
  )
}

export default LoginPage
